import React from 'react'

function Home() {
    return (
        <div className='kato' >
            <div class="card border-0">
                <img src="assets/bg.jpg" class="card-img" alt="background" height="550px" />
                <div class="card-img-overlay d-flex flex-column ">
                    <div className="container">
                        <h4 class="card-title display-3 fw-bolder mb-0">Get Fruits from Affordable Price</h4>
                        <p class="card-text lead fs-2">From the Best Fruits Store</p>
                    </div>

                </div>
            </div>

        </div>
    );
};

export default Home
